export default class Starwars extends React.Component {
    constructor(){
        super()
        this.state={
          person : []
        }
      }
      componentDidMount() {
        fetch('https://svcs.ebay.com/services/search/FindingService/v1?OPERATION-NAME=findItemsByKeywords&SERVICE-VERSION=1.0.0&SECURITY-APPNAME=KarimZit-TestKey-PRD-83882c164-20d40dd0&RESPONSE-DATA-FORMAT=JSON&REST-PAYLOAD&keywords=harry%20potter%20phoenix&itemFilter.name=MaxPrice&itemFilter.value=10.00&itemFilter.paramName=Currency&itemFilter.paramValue=USD&paginationInput.entriesPerPage=2')
          .then(response => {return response.json()})
          .then(data => this.setState({person: data}) 
          ,console.log(this.state.person)
          )       
    } 
    render(){ 
        return (
        <div>
            <h1>
            {this.state.person}
            </h1>
        </div>)
    }
}
